import "./home.css";
import { AuthContext } from "../../context/AuthContext";
import { useContext, useRef } from "react";
import Navbar from "../../components/navbar/Navbar";

export default function Home() {
    const { user } = useContext(AuthContext);

    return (
        <>
            <Navbar />
            <div className="home">
                <div className="homeTop">
                    <button className="filterBtn daily">Daily</button>
                    <button className="filterBtn tips">Tips</button>
                    <button className="filterBtn facts">Facts</button>
                    <button className="filterBtn rec">Recommend</button>
                </div>
                <div className="homeBottom">
                    <div className="homeLeft"></div>
                    <div className="homeRight"></div>
                </div>
            </div>
        </>
    );
}
